const FeedbackItem = ({ feedback }) => {
  if (!feedback || feedback.length === 0) {
    return <p>No Feedback</p>;
  }

  return (
    <>
      <div className="card">
        {feedback.map((item) => (
          <List item={item} />
        ))}
      </div>
    </>
  );
};

export default FeedbackItem;
